import React from 'react';
import UserInfo from './UserInfo';
import UserPosts from './PostTeste';

const user = {
    src: 'caminho/para/imagem-de-perfil.jpg',
    alt: 'Imagem de Perfil',
    name: 'João Silva',
    email: 'joao.silva@exemplo.com',
    otherInfo: 'Informações adicionais sobre o usuário'
};

const posts = [
    { text1: 'Texto do Post 1 - Parte 1', text2: 'Texto do Post 1 - Parte 2', text3: 'Texto do Post 1 - Parte 3' },
    { text1: 'Texto do Post 2 - Parte 1', text2: 'Texto do Post 2 - Parte 2', text3: 'Texto do Post 2 - Parte 3' },
    // mais posts...
];

function App() {
    return (
        <div>
            <UserInfo user={user} />
            <UserPosts posts={posts} />
        </div>
    );
}

export default App;
